HQ promo music video from a promo DVD. &quot;Pinhead&quot; is a song from Leave Home, the second studio album by American punk rock band The Ramones. It was released on January 10, 1977 through Sire Records. The album features the classic Ramones songs &quot;Pinhead&quot; and &quot;Gimme Gimme Shock Treatment&quot;. It is the only Ramones album to go through different incarnations on its original release, due to label controversy over the song &quot;Carbona Not Glue&quot;.

&quot;Pinhead&quot; was inspired after the band attended a screening of the 1932 film Freaks when a show in Ohio was canceled. The song became, along with &quot;Blitzkrieg Bop&quot;, something of an anthem for the band, as the chorus of &quot;Gabba gabba hey,&quot; based on the line from the film &quot;gooble gobble, gooble gobble, one of us, one of us&quot; (uttered in the song as &quot;gabba gabba/we accept you/we accept you/one of us&quot;) became a rallying cry for the band. At many shows a roadie named Bubbles in a pinhead mask would take to the stage at the end of the show, carrying a large sign with the phrase written on it.

The Ramones were an American rock band that formed in the New York City neighborhood of Forest Hills, Queens, in 1974. They are often cited as the first punk rock group. Despite achieving only limited commercial success, the band was a major influence on the punk rock movement both in the United States and the United Kingdom.

All of the band members adopted pseudonyms ending with the surname &quot;Ramone&quot;, though none of them were related. They performed 2,263 concerts, touring virtually nonstop for 22 years. In 1996, after a tour with the Lollapalooza music festival, the band played a farewell concert and disbanded. Little more than eight years after the breakup, the band's three founding membersÃ¢â‚¬â€lead singer Joey Ramone, guitarist Johnny Ramone, and bassist Dee Dee RamoneÃ¢â‚¬â€had died.
